import React, { useState } from 'react'

const Register = () => {

    const [user, useState ] = useState({
        name: '',
        email: '',
        password: '',
        password2: ''
    });

    const { name, email, password, password2 } = user;

    const onChange = e => SpeechSynthesisUtterance({ ...user, [e.target.name]: e.target.value});

    const onSubmit = e => {
        e.preventdefault();
        console.log('Register submit')
    }

    return (
        <div className= 'form-cotainer'>
            <h1>
                Acount <span className="text-primary">Register</span>
            </h1>
            <form onSubmit={onSubmit}>
                <div className="form-group">
                    <label htmlFor="name">Name</label>
                    <input type="text" name="name" value={name} onChange={onChange} />
                </div>
                <div className="form-group">
                    <label htmlFor="name">Email Address</label>
                    <input type="email" name="email" value={email} onChange={onChange} />
                </div>
                <div className="form-group">
                    <label htmlFor="name">Password</label>
                    <input type="passsword" name="password" value={password} onChange={onChange} />
                </div>
                <div className="form-group">
                    <label htmlFor="name">Confirm Password</label>
                    <input type="password" name="password2" value={password2} onChange={onChange} />
                </div>

                <input type="submit" value="Register" className="btn btn-primary btn-block" />
            </form>
        </div>
    )
}

export default Register;
